import React from "react";
import { HomeState, initHomeState, Person } from "./home.state";
import { RegistrationForm } from "../RegistrationForm/registration";



export class Home extends React.Component<{},HomeState>{
    constructor(props: {}){
        //props are readonly information that is passed from a paren t component to their children
        super(props)//base class
        this.state = initHomeState 
    }

    render():JSX.Element{
        switch (this.state.view){
            case "home":
                return (
                    <div>
                    Welcome to our home page!
                        <div>
                            <button
                                onClick={_ => this.setState(this.state.updateViewState("registration"))}
                            >
                                Registration Form
                            </button>
                        </div>
                        <div>
                            <button>
                                Overview
                            </button>
                        </div>
                    </div>
                )

            case "registration":
                return(
                    <RegistrationForm
                        insertPerson={(person:Person) => this.setState(this.state.insertPerson)}
                    />
                )
            case "overview":
                return <></>

        }

    }
}
